export default class MainBackDrop extends Component {
    render() {
        return (
            <div className = "main-back-drop">
                <h1>CAREERS UNCORKED</h1>
                <h3>ONE COMMUNITY, WHERE JOURNEYS CONVERGE</h3>
                <h4>SIGN UP TO OUR MAILING LIST TO RECEIVE A REMINDER FOR OURUPCOMING EVENTS</h4>
            </div>
        )
    }
}
